/*
*
* Preloader
*/
.preloader {
	position: fixed;
	left: 0;
	top: 0;
	bottom: 0;
	right: 0;
	z-index: 10000;
	display: flex;
	justify-content: center;
	align-items: center;
	padding: 20px;
	background: #ffffff;
	transition: .3s all ease;
}

.preloader.loaded {
	opacity: 0;
	visibility: hidden;
}

.preloader-body {
	text-align: center;
}

.preloader-body p {
	position: relative;
	right: -8px;
}

.cssload-container {
	width: 100%;
	height: 36px;
	text-align: center;
}

.cssload-speeding-wheel {
	width: 36px;
	height: 36px;
	margin: 0 auto;
	border: 3px solid #1972c6;
	border-radius: 50%;
	border-left-color: transparent;
	border-bottom-color: transparent;
	animation: cssload-spin .88s infinite linear;
}

@-webkit-keyframes cssload-spin {
	100% {
		transform: rotate(360deg);
	}
}

@keyframes cssload-spin {
	100% {
		transform: rotate(360deg);
	}
}

/*
* @section      Extensions
* @description  This section holds some of style declarations for necessary
*               scripts
*/
/*
* @subsection   RD Navbar
*
* @description  Describes style declarations for RD Navbar extension
*
* @author       Evgeniy Gusarov
* @link         https://ua.linkedin.com/pub/evgeniy-gusarov/8a/a40/54a
* @version      2.0.0
*/
@-webkit-keyframes rd-navbar-slide-down {
	0% {
		-webkit-transform: translateY(-100%);
		transform: translateY(-100%);
	}
	100% {
		-webkit-transform: translateY(0);
		transform: translateY(0);
	}
}

@keyframes rd-navbar-slide-down {
	0% {
		-webkit-transform: translateY(-100%);
		transform: translateY(-100%);
	}
	100% {
		-webkit-transform: translateY(0);
		transform: translateY(0);
	}
}

@-webkit-keyframes rd-navbar-slide-up {
	0% {
		-webkit-transform: translateY(0);
		transform: translateY(0);
	}
	100% {
		-webkit-transform: translateY(-100%);
		transform: translateY(-100%);
	}
}

@keyframes rd-navbar-slide-up {
	0% {
		-webkit-transform: translateY(0);
		transform: translateY(0);
	}
	100% {
		-webkit-transform: translateY(-100%);
		transform: translateY(-100%);
	}
}

/*
* @subsection General Styles
*/
.rd-navbar-wrap, .rd-navbar-static .rd-menu {
	transition: 0.3s all cubic-bezier(0.785, 0.135, 0.15, 0.86);
}

.rd-navbar, .rd-navbar.rd-navbar--is-clone {
	display: none;
}

.rd-navbar-fixed,
.rd-navbar-static,
.rd-navbar-fullwidth,
.rd-navbar-sidebar {
	display: block;
}

.rd-navbar--no-transition, .rd-navbar--no-transition * {
	transition: none !important;
}

.rd-navbar-wrap, .rd-navbar, .rd-navbar-brand, .rd-navbar-slogan,
.rd-navbar-dropdown, .rd-navbar-inner, .rd-navbar-megamenu, .rd-navbar-collapse-items,
.brand-name, .rd-navbar-nav, .rd-navbar-panel, .rd-navbar-search-form-input,
.rd-navbar-search-form-submit, .rd-navbar-search-toggle,
.rd-navbar-live-search-results, .rd-navbar-search-form {
	transition: .3s all ease;
}

.rd-navbar-collapse-toggle {
	display: none;
}

.rd-navbar--has-sidebar body {
	padding-left: 270px;
}

.rd-navbar--is-stuck {
	box-shadow: 0 0 0 rgba(0, 0, 0, 0.12), 3px 4px 8px 0px rgba(0, 0, 0, 0.11);
}

.rd-navbar.rd-navbar-fixed + .rd-navbar.rd-navbar--is-clone,
.rd-navbar.rd-navbar-sidebar + .rd-navbar.rd-navbar--is-clone {
	display: none;
}

.rd-navbar.rd-navbar--is-stuck.rd-navbar--loading {
	visibility: hidden;
	-webkit-transform: translateY(-100%);
	transform: translateY(-100%);
}

/*
* Navbar components
*/
.rd-navbar {
	display: none;
	background: #ffffff;
}

.rd-navbar-toggle {
	display: inline-block;
	position: relative;
	width: 48px;
	height: 48px;
	line-height: 48px;
	cursor: pointer;
	color: #333333;
	display: none;
}

.rd-navbar-toggle span {
	position: relative;
	display: block;
	margin: auto;
	transition: .3s all ease;
}

.rd-navbar-toggle span:after, .rd-navbar-toggle span:before {
	content: "";
	position: absolute;
	left: 0;
	top: -8px;
	transition: .3s all ease;
}

.rd-navbar-toggle span:after {
	top: 8px;
}

.rd-navbar-toggle span:after, .rd-navbar-toggle span:before, .rd-navbar-toggle span {
	width: 24px;
	height: 4px;
	background-color: #333333;
	backface-visibility: hidden;
	border-radius: 2px;
}

.rd-navbar-toggle span {
	-webkit-transform: rotate(180deg);
	transform: rotate(180deg);
}

.rd-navbar-toggle span:before, .rd-navbar-toggle span:after {
	-webkit-transform-origin: 1.71429px center;
	transform-origin: 1.71429px center;
	-webkit-transform-origin: 1.71429px center;
	transform-origin: 1.71429px center;
}

.rd-navbar-toggle.active span {
	-webkit-transform: rotate(360deg);
	transform: rotate(360deg);
}

.rd-navbar-toggle.active span:before, .rd-navbar-toggle.active span:after {
	top: 0;
	width: 15px;
}

.rd-navbar-toggle.active span:before {
	-webkit-transform: rotate3d(0, 0, 1, -40deg);
	transform: rotate3d(0, 0, 1, -40deg);
}

.rd-navbar-toggle.active span:after {
	-webkit-transform: rotate3d(0, 0, 1, 40deg);
	transform: rotate3d(0, 0, 1, 40deg);
}

.rd-navbar-brand {
	letter-spacing: 3px;
}

.rd-navbar-brand .brand-name {
	display: inline-block;
	font-family: 'Montserrat';
	color: #000;
	font-size: 30px;
	line-height: 40px;
	font-weight: 700;
	text-transform: uppercase;
}

.rd-navbar-brand .brand-slogan {
	display: inline-block;
	color: #c2c2c2;
	font-size: 14px;
	line-height: 1;
	text-transform: uppercase;
	margin-top: -5px;
}

@media (min-width: 1200px) {
	.rd-navbar-brand {
		padding-top: 10px;
	}
}

.login-form .rd-mailform label input, .login-form .rd-mailform label textarea {
	color: #c2c2c2;
	border: 1px solid #e1e1e1;
}

.login-form .mfPlaceHolder {
	color: #c2c2c2;
}

.login-form .rd-navbar-collapse, .login-form .rd-navbar-collapse:before {
	transition: 0.5s all cubic-bezier(0.785, 0.135, 0.15, 0.86);
}

.login-form .rd-navbar-collapse-toggle {
	display: inline-block;
	position: fixed;
	right: 10px;
	top: 13px;
	font-family: 'FontAwesome';
	z-index: 999;
	transition: .5s all ease;
}

.login-form .rd-navbar-collapse-toggle span {
	display: inline-block;
	position: relative;
	cursor: pointer;
}

.login-form .rd-navbar-collapse-toggle span:before, .login-form .rd-navbar-collapse-toggle span:after {
	content: '';
	color: #1972c6;
	position: absolute;
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	transition: .5s all ease;
}

.login-form .rd-navbar-collapse-toggle span:before {
	content: '\f007';
	-webkit-transform: rotate(0deg) scale(1);
	transform: rotate(0deg) scale(1);
	opacity: 1;
	visibility: visible;
}

.login-form .rd-navbar-collapse-toggle span:after {
	content: '\f00d';
	-webkit-transform: rotate(-90deg) scale(0);
	transform: rotate(-90deg) scale(0);
	opacity: 0;
	visibility: hidden;
}

.login-form .rd-navbar-collapse-toggle:hover span:before {
	color: #d52828;
}

.login-form .rd-navbar-collapse-toggle.active span:before {
	opacity: 0;
	visibility: hidden;
	-webkit-transform: rotate(90deg) scale(0);
	transform: rotate(90deg) scale(0);
}

.login-form .rd-navbar-collapse-toggle.active span:after {
	-webkit-transform: rotate(0deg) scale(1);
	transform: rotate(0deg) scale(1);
	opacity: 1;
	visibility: visible;
}

.login-form .rd-navbar-collapse-toggle.active:hover span {
	color: #0e3e6b;
}

.login-form .rd-navbar-collapse {
	display: block;
	position: fixed;
	right: 10px;
	top: 60px;
	padding: 15px;
	z-index: 19;
	width: 250px;
	visibility: hidden;
	overflow: hidden;
	transition: .3s box-shadow ease .2s;
}

.login-form .rd-navbar-collapse:before {
	content: '';
	position: absolute;
	top: 0;
	right: 0;
	background: #ffffff;
	border-radius: 50%;
