/*
* MF Select
*/
.mfSelect {
	position: relative;
}

.mfSelect select {
	padding: 0px 1px 1px 0;
	z-index: -9999999;
	border: medium none;
}

.mfSelect .dropdown {
	position: absolute;
	top: 100%;
	left: 0;
	width: 100%;
	padding-top: 5px;
	padding-bottom: 5px;
	margin-top: 15px;
	max-height: 300px;
	opacity: 0;
	visibility: hidden;
	border: 1px solid #888;
	box-shadow: 3px 4px 8px 0px rgba(0, 0, 0, 0.11);
	transition: .3s all ease-in-out;
	outline: none;
	-webkit-appearance: none;
	font-weight: inherit;
	line-height: 26px;
	border: 1px solid #cccccc;
	background: #fff;
	color: #bebebe;
	border-radius: none;
	z-index: 1;
	-webkit-transform: translateY(20px);
	transform: translateY(20px);
}

.mfSelect .dropdown .option {
	position: relative;
	z-index: 1;
	text-transform: none;
	cursor: pointer;
	padding: 10px 15px;
	overflow: hidden;
	transition: .4s all ease-in-out;
	transition-delay: .2s;
	font-size: 16px;
	line-height: 30px;
}

.mfSelect .dropdown .option.selected {
	background: #f2f2f2;
	color: #bebebe;
}

.mfSelect .dropdown .option:after {
	content: '';
	position: absolute;
	left: 0;
	top: 0;
	width: 0;
	height: 0;
	-webkit-border-radius: 50%;
	-moz-border-radius: 50%;
	border-radius: 50%;
	background: #1972c6;
	opacity: 0;
	z-index: -1;
	transition: .4s all ease-in-out;
	-webkit-transform: translate(-20%, -50%);
	transform: translate(-20%, -50%);
}

.mfSelect .dropdown .option:before {
	content: '\f00c';
	position: absolute;
	display: inline-block;
	left: 15px;
	color: #ffffff;
	font: 400 20px "FontAwesome";
	line-height: inherit;
	transition: .4s all ease-in-out;
	-webkit-transform: scale(0) rotate(-60deg);
	transform: scale(0) rotate(-60deg);
}

.mfSelect .dropdown .option:hover {
	color: #ffffff;
	padding-left: 40px;
	transition-delay: 0s;
}

.mfSelect .dropdown .option:hover:before {
	transition-delay: .15s;
	-webkit-transform: scale(1) rotate(0deg);
	transform: scale(1) rotate(0deg);
}

.mfSelect .dropdown .option:hover:after {
	width: 1000px;
	height: 500px;
	opacity: 1;
}

.mfSelect .dropdown:before {
	content: '';
	position: absolute;
	bottom: 100%;
	left: 14px;
	width: 0;
	height: 0;
	border-style: solid;
	border-width: 0 7px 8px 7px;
	border-color: transparent transparent #cccccc transparent;
}

.mfSelect .dropdown:after {
	content: '';
	position: absolute;
	bottom: 100%;
	left: 15px;
	width: 0;
	height: 0;
	border-style: solid;
	border-width: 0 6px 6px 6px;
	border-color: transparent transparent #FFF transparent;
}

.mfSelect .value {
	cursor: pointer;
	transition: .4s all ease-in-out;
	font-size: 16px;
	padding: 11px 17px;
	line-height: 26px;
	color: #bebebe;
	background: #ffffff;
	border: 1px solid #cccccc;
	border-radius: none;
}

.mfSelect .value:before, .mfSelect .value:after {
	position: absolute;
	right: 12px;
	top: 13px;
	width: 24px;
	height: 24px;
	font: 400 18px "FontAwesome";
	line-height: 24px;
	color: #bebebe;
	text-align: center;
	transition: .4s all ease;
}

.mfSelect .value:before {
	content: '\f107';
	font-size: 18px;
}

.mfSelect.show .dropdown {
	opacity: 1;
	visibility: visible;
	-webkit-transform: translateY(0);
	transform: translateY(0);
}

.mfSelect.show .value {
	background: #fff;
	color: #bebebe;
	box-shadow: 0 0 0 rgba(0, 0, 0, 0.12), 3px 4px 8px 0px rgba(0, 0, 0, 0.11);
}

