/*
* MF Datepicker
*/
.mfDatePicker {
	position: absolute;
	top: 100%;
	left: 0;
	margin-top: 10px;
	opacity: 0;
	z-index: 1;
	width: 280px;
	visibility: hidden;
	-webkit-box-shadow: 0px 1px 6px 0px rgba(0, 0, 0, 0.31);
	-moz-box-shadow: 0px 1px 6px 0px rgba(0, 0, 0, 0.31);
	box-shadow: 0px 1px 6px 0px rgba(0, 0, 0, 0.31);
	transition: .3s all ease-in-out;
	z-index: 99;
	-webkit-transform: translateY(20px);
	transform: translateY(20px);
	background: #ffffff;
	color: #1972c6;
	border-radius: 0;
}

.mfDatePicker:before {
	content: '';
	position: absolute;
	left: 23px;
	width: 12px;
	height: 12px;
	background: #fff;
	-webkit-transform: rotate(45deg);
	transform: rotate(45deg);
	top: 0;
	margin-top: -6px;
	-webkit-box-shadow: 0px 1px 6px 0px rgba(0, 0, 0, 0.31);
	-moz-box-shadow: 0px 1px 6px 0px rgba(0, 0, 0, 0.31);
	box-shadow: 0px 1px 6px 0px rgba(0, 0, 0, 0.31);
	z-index: -1;
}

.mfDatePicker table {
	text-align: center;
	border-collapse: separate;
	border-spacing: 3px;
	font-size: 14px;
	line-height: 24px;
	padding: 0 35px 28px 28px;
}

.mfDatePicker table th {
	font-weight: 300;
	color: #000;
	font-size: 12px;
	line-height: 24px;
}

.mfDatePicker table td {
	width: 27px;
	height: 27px;
	line-height: 27px;
	text-align: center;
	cursor: pointer;
	transition: .3s all ease;
	border-radius: 50%;
}

.mfDatePicker table td:hover {
	color: #ffffff;
	background: #d52828;
}

.mfDatePicker table td.dp-offset {
	color: #c6bbba;
}

.mfDatePicker table td.dp-today {
	color: #333333;
	background: #fff;
}

.mfDatePicker table td.dp-selected {
	color: #ffffff;
	background: #ed2d2d;
}

.mfDatePicker_title {
	font-size: 16px;
	line-height: 24px;
	color: #000;
}

.mfDatePicker_next, .mfDatePicker_prev {
	font: 400 18px "FontAwesome";
	line-height: inherit;
	text-align: center;
	color: #1972c6;
	cursor: pointer;
}

.mfDatePicker_next:hover, .mfDatePicker_prev:hover {
	color: #ed2d2d;
}

.mfDatePicker_panel {
	text-align: center;
	line-height: 24px;
	background: #ffffff;
	padding-top: 31px;
	padding-left: 39px;
	padding-right: 45px;
}

.mfDatePicker_next {
	float: right;
}

.mfDatePicker_next:before {
	content: '\f105';
}

.mfDatePicker_prev {
	float: left;
}

.mfDatePicker_prev:before {
	content: '\f104';
}

.mfDatePicker_panel + table {
	margin-top: 11px;
}

.mfDatePicker.open {
	-webkit-transform: translateY(0);
	transform: translateY(0);
	opacity: 1;
	visibility: visible;
}

@media (max-width: 767px) {
	.datepicker-inverse .mfDatePicker {
		right: 0;
		left: auto;
	}
	.datepicker-inverse .mfDatePicker:before {
