		left: auto;
	}
}

/**
 * RD Toggles
 * @Section
 */
label {
	cursor: pointer;
}

label span {
	display: inline-block;
}

.mfToggle__input-outer {
	content: "";
	display: inline-block;
	width: 30px;
	height: 15px;
	background-color: rgba(26, 57, 52, 0.7);
	border-radius: 15px;
	margin-right: 10px;
	transition: background 0.3s ease;
	vertical-align: middle;
	margin-left: 10px;
}

.mfToggle__input-outer:after {
	content: "";
	display: inline-block;
	width: 20px;
	height: 21px;
	background-color: #F1F1F1;
	border-radius: 20px;
	position: relative;
	box-shadow: 0 1px 3px 1px rgba(0, 0, 0, 0.4);
	left: -9px;
	top: -4px;
	transition: left 0.3s ease, background 0.3s ease, box-shadow 0.1s ease;
}

.mfToggle__input-outer:active:after {
	box-shadow: 0 1px 3px 1px rgba(0, 0, 0, 0.4), 0 0 0 15px rgba(32, 78, 70, 0.3);
}

.mfToggle__input-outer.active {
	background-color: rgba(11, 77, 70, 0.76);
}

.mfToggle__input-outer.active:after {
	background-color: #4ab19f;
	left: 11px;
}

.mfToggle__input-outer.active:active:after {
	box-shadow: 0 1px 3px 1px rgba(0, 0, 0, 0.4), 0 0 0 15px rgba(27, 105, 74, 0.35);
}

.mfToggle__input-outer input[type="checkbox"] {
	position: absolute !important;
	margin: 0 !important;
	padding: 0 !important;
	top: 0 !important;
	left: 0 !important;
	height: 0 !important;
	width: 0 !important;
	border: none !important;
	overflow: hidden !important;
	opacity: 0 !important;
	z-index: -999999 !important;
}

.mfToggle__input-outer input[type="checkbox"] span {
	font-weight: 300;
}

.mfCheckbox__input {
	visibility: hidden;
}

.mfCheckbox__input-outer {
	position: relative;
	width: 16px;
	height: 16px;
	display: inline-block;
	border: 1px solid #000000;
	overflow: hidden;
	margin-right: 10px;
	vertical-align: text-bottom;
}

.mfCheckbox__input-outer:before {
	content: '\f00c';
	font-family: 'FontAwesome';
	font-size: 14px;
	color: #000000;
	position: absolute;
	transition: .3s;
	opacity: 0;
	display: block;
	margin-top: -5px;
	margin-left: 0px;
	width: 0;
	height: 0;
}

.mfCheckbox__input-outer:after {
	display: block;
	position: absolute;
	content: "";
	left: -5px;
	top: -15px;
	height: 50px;
	width: 50px;
	z-index: 1;
	opacity: 0;
	margin: 0;
}

.mfCheckbox__input-outer.active:before {
	opacity: 1;
}

.mfRadio__input-outer {
	vertical-align: middle;
	position: relative;
	display: inline-block;
	width: 18px;
	height: 18px;
	margin-left: 12px;
	border: 2px solid #333;
	border-radius: 100%;
	transition: 0.1s ease;
}

.mfRadio__input-outer:after {
	content: '';
	position: absolute;
	top: 3px;
	left: 3px;
	right: 3px;
	bottom: 3px;
	background-color: transparent;
	border-radius: 100%;
	transition: background 0.3s ease;
}

.mfRadio__input-outer:active {
	box-shadow: 0 1px 3px 1px rgba(220, 220, 220, 0.4), 0 0 0 15px rgba(133, 148, 171, 0.52);
}

.mfRadio__input-outer:hover:after {
	background-color: rgba(0, 0, 0, 0.4);
}

.mfRadio__input-outer.active:after {
	background-color: #333;
}

.mfRadio__input-outer.active:active {
	box-shadow: none;
}

.mfRadio input[type="radio"] {
	position: absolute !important;
	margin: 0 !important;
	padding: 0 !important;
	top: 0 !important;
	left: 0 !important;
	height: 0 !important;
	width: 0 !important;
	border: none !important;
	overflow: hidden !important;
	opacity: 0 !important;
	z-index: -999999 !important;
}

