	text-align: center;
	padding: 0;
	position: relative;
}

.dtp-date, .dtp-time {
	background: #2d8ce5;
	text-align: center;
	color: #ffffff;
	padding: 10px;
}

.dtp-date > div {
	padding: 0;
	margin: 0;
	display: flex;
	justify-content: center;
	align-items: center;
	margin-top: 6px;
}

.dtp-actual-month {
