	line-height: 0.9;
}

.dtp-actual-year {
	font-size: 1.5em;
	color: #ffffff;
}

.dtp-picker {
	padding: 20px 15px;
	text-align: center;
}

.dtp-picker-month, .dtp-actual-time {
	font-weight: 500;
