	right: 16px;
}

.dtp-close > a {
	display: inline-block;
	vertical-align: middle;
	color: #ffffff;
}

.dtp table.dtp-picker-days {
	margin: 0;
	border: none;
}

.dtp table.dtp-picker-days tr {
	border: none;
}

.dtp table.dtp-picker-days tr > td {
	border: none;
	font-weight: 700;
	font-size: 14px;
	text-align: center;
	padding: 10px 5px;
}

.dtp table.dtp-picker-days tr > td > span.dtp-select-day {
	color: #BDBDBD !important;
}

.dtp table.dtp-picker-days tr > td > a {
	color: #cccccc;
	width: 24px;
	height: 24px;
	display: inline-block;
	text-align: center;
	line-height: 24px;
	border-radius: 50%;
	transition: .3s all ease;
}

.dtp .dtp-picker-time > a {
	color: #cccccc;
	padding: 4px 5px 6px 5px;
	border-radius: 50% !important;
}

.dtp table.dtp-picker-days tr > td > a.selected {
	background: #1972c6;
	color: #ffffff;
}

.dtp table.dtp-picker-days tr > th {
	color: #cccccc;
	text-align: center;
	font-weight: 700;
	padding: 5px;
	border-bottom: none;
}

.dtp .p10, .dtp .p20, .dtp .p60, .dtp .p80 {
	display: inline-block;
	vertical-align: middle;
}

.dtp .p10 {
	width: 10%;
}

.dtp .p10 > a {
	color: #edeff4;
	transition: .3s all ease;
	display: flex;
	align-items: center;
}

.dtp .p10 > a:hover {
	color: #ffffff;
}

.dtp .p20 {
	width: 20%;
}

.dtp .p60 {
	width: 60%;
}

.dtp .p80 {
	width: 80%;
}

.dtp-picker-month {
	display: none !important;
}

.dtp-meridien-am, .dtp-meridien-pm {
	position: relative;
	top: 10px;
	color: #cccccc;
	font-weight: 500;
	border-radius: 50% !important;
	text-decoration: none;
	background: #eee;
	font-size: 10px;
	padding: 7px 5px;
}

.dtp-actual-meridien a.selected {
	background: #1972c6;
	color: #ffffff;
}

.dtp-picker-time {
	position: absolute;
	width: 30px;
	height: 30px;
	font-size: 1em;
	border-radius: 50%;
	cursor: pointer;
	font-weight: 500;
	text-align: center !important;
}

.dtp-picker-time > a {
	display: block;
	line-height: 20px;
	padding: 0.3rem 0.3rem 0.3rem 0.3rem;
}

.dtp-picker-time > a.dtp-select-hour.selected {
